kées sur votre ordinateur ou sur tout autre appareil.\r\n\r\nEn cliquant sur ”OK, j’accepte”, vous acceptez l’utilisation des cookies. Pour en savoir plus, veuillez-vous reporter à la section', 'Bienvenue sur le site e-commerce de TotalEnergies Marketing Madagasikara SA', 'Chers clients, chères clientes,\r\n\r\n\r\n\r\nPour faciliter votre quotidien et vous satisfaire, nous sommes à votre service pour vous aider à faire vos courses en achetant directement sur notre site e-commerce.\r\nChoisissez votre station, remplissez votre panier et définissez l’heure à laquelle vous souhaitez récupérer vos articles.\r\nLe paiement sera effectué à la récupération de vos articles.'),
